import React from 'react';
import useCollapse from 'react-collapsed';
import PlayerStatisticsComponent from './player-statistics.component';
import PlayerStatisticsCompressedComponent from './player-statistics-compressed.component';

const Collapsible = ({datas}) => {
    const { getCollapseProps, getToggleProps, isExpanded } = useCollapse();
    return (
        <div>
            <div {...getToggleProps()}>
                {isExpanded ? <PlayerStatisticsComponent datas={datas}/> : <PlayerStatisticsCompressedComponent datas={datas}/>}
            </div>
            <div {...getCollapseProps()}>
                <div>
                </div>
            </div>
        </div>
        );
}

export default Collapsible;
